import React from "react";

const Error503 = () => {
  return (
    <div>
      <h1>503 - 서비스 이용 불가</h1>
      <p>현재 서버가 유지보수 중이거나 과부하 상태입니다.</p>
    </div>
  );
};

export default Error503;
